          <i class='fab fa-instagram' />
        </Link>
        <Link
          class='social-icon-link twitter'
          to='/'
          target='_blank'
          aria-label='Twitter'
        >
          <i class='fab fa-twitter' />
        </Link>
      </div>
      <small class='website-rights'>paulinemargÂ© 2022</small>
    </div>
  );
}

export default Footer;
